"ุฃููููู ุณูููุนู ููุนูุงููููุฉู ุจูู ุฃูุจูู ุณูููููุงููุ ุฎูุทููุจูุง ุจุงูููุฏููููุฉูุ ููุนูููู ูู ููุฏูููุฉู ููุฏูููููุงุ ุฎูุทูุจููููู ููููู ุนูุงุดููุฑูุงุกูุ ูููุงูู: ุฃููููู ุนูููููุงุคูููููุ ูุง ุฃููููู ุงูููุฏููููุฉูุ ุณูููุนูุชู ุฑูุณููู ุงูููู ุตููููู ุงูููููู ุนููู ูุณููููู ูููููุ ูููุฐุง ุงููููููุ ูุฐุง ูููููู ุนูุงุดููุฑูุงุกูุ ูููููู ููููุชูุจู ุงูููููู ุนููููููู ุตูููุงููููุ ููุฃูููุง ุตูุงุฆูููุ ูููู ุฃูุญูุจูู ูููููู ุฃููู ููุตูููู ููููููุตูููุ ููููู ุฃูุญูุจูู ุฃููู ููููุทูุฑู ููููููููุทูุฑู. [ููู ุฑูุงูุฉ]: ุณูููุนู ุงููุจููู ุตููููู ุงูููููู ุนููู ูุณููููู ููููู ูู ููุซููู ูุฐุง ุงูููููู: ุฅูููู ุตูุงุฆูููุ ูููู ุดูุงุกู ุฃููู ููุตูููู ููููููุตููู ูููููู ููุฐูููุฑู ุจูุงููู ุญูุฏูุซู ููุงููููุ ูููููููุณู.\n\n- ุงูุฑุงูู: ูุนุงููุฉ ุจู ุฃุจู ุณููุงู \n- ุญูู ุงูุญุฏูุซ: [ุตุญูุญ]",
"ููุฏููู ุฑูุณููู ุงูููู ุตููููู ุงูููููู ุนููู ูุณููููู ุงูููุฏููููุฉูุ ููููุฌูุฏู ุงููููููุฏู ููุตููููููู ููููู ุนูุงุดููุฑูุงุกู ููุณูุฆููููุง ุนู ุฐูููุ ูููุงููุง: ูุฐุง ุงููููููู ุงูุฐู ุฃูุธูููุฑู ุงูููููู ููู ูููุณููุ ููุจูููู ุฅุณูุฑูุงุฆูููู ุนููู ููุฑูุนูููููุ ููููุญููู ููุตูููููู ุชูุนูุธููููุง ููุ ูููุงูู ุงููุจููู ุตููููู ุงูููููู ุนููู ูุณููููู: ููุญููู ุฃูููููู ุจูููุณูู ูููููู ูุฃููุฑู ุจุตููููููู\n\n- ุงูุฑุงูู: ุนุจุฏุงููู ุจู ุนุจุงุณ \n- ุญูู ุงูุญุฏูุซ: [ุตุญูุญ]",
